import React, {useState} from 'react'
import sobe from '../images/icon-sobe.png'
import desce from '../images/icon-desce.png'

export const Informacoes = (props) => {



    return (
        <div className="container-informacoes" >
            <h3>{props.titulo}</h3>
            {props.texto}

            <div className="navegacao">
              <img className='navegacao-img sobe' src={sobe} onClick={props.handleSobe}/>
              <img className='navegacao-img desce' src={desce} onClick={props.handleDesce} />
            </div> 
        </div>
    )
}


